import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

function Page(props) {

  var pages = [];

  for (var i = 0; i < props.pages.length; i++) {
    pages.push({
        blocks:[],
        dimensions: {
          width: props.pages[i].width,
          height: props.pages[i].height
        }
    });

    for (var j = 0; j < props.pages[i].blocks.length; j++) {
      pages[i].blocks.push({
        paragraphs:[],
        coordinate: {
          x:{
            left: props.pages[i].blocks[i].boundingBox.vertices[0].x,
            right: props.pages[i].blocks[i].boundingBox.vertices[1].x
          },
          y:{
            left: props.pages[i].blocks[i].boundingBox.vertices[0].y,
            right: props.pages[i].blocks[i].boundingBox.vertices[w].y
          }
        }
      });

      for (var k = 0; k < props.pages[i].blocks[j].paragraphs.length; k++) {

        var paragraphs = '';

        for (var l = 0; l < props.pages[i].blocks[j].paragraphs[k].words.length; l++) {
          for (var m = 0; m < props.pages[i].blocks[j].paragraphs[k].words[l].symbols.length; m++) {
            paragraphs += props.pages[i].blocks[j].paragraphs[k].words[l].symbols[m].text;
          }
        }

        pages[i].blocks[j].paragraphs.push ({
          element:paragraphs,
          coordinate: {
            x:{
              left: props.pages[i].blocks[j].paragraphs[k].boundingBox.vertices[0].x,
              right: props.pages[i].blocks[j].paragraphs[k].boundingBox.vertices[1].x
            },
            y:{
              left: props.pages[i].blocks[j].paragraphs[k].boundingBox.vertices[0].y,
              right: props.pages[i].blocks[j].paragraphs[k].boundingBox.vertices[2].y
            }
          }
        });
      }

    }

  }

  return (
    pages.map(page => {
      <body style={{width:page.dimensions.width, height:page.dimensions.height}}></body>
    })
  );

}

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      items:{},
      isLoaded:false
    }
  }

  componentDidMount() {

      var data = require('/Users/jaminapps/Documents/Programming/react/testparse/src/out.json');
      console.log(data);
      this.setState({
        item: data,
        isLoaded:true,
      });
  }

  render() {

    var { isLoaded, item } = this.state;
    console.log(item);

    var pages = [];


    pages.push({
      blocks:[],
      coordinate: {
        x: 572,
        y: 700
      }
    });

    return (
      <Page data={item} />
    );
  }
}

export default App;
